import './error_page.css';

import Template from '../template/template';
import ErrorImage from './static_assets/ErrorImage.png';

function ErrorPage() {
  return (
    <Template> 
      <div class='errorWpr'>
        <div class='errorImage'>
          <img src={ErrorImage}/>
        </div>
        <div class='txt'>

        </div>
      </div>



    </Template>
  );
}

export default ErrorPage;
